            {props.item.map(u => <div key={u.id}>
                <div className={s.container_name}>{u.eat.name}</div>
                <div className={s.container_cost}>{u.eat.cost}</div>
                <div className={s.container_photo}>{u.eat.photoURL}</div>
            </div>)}
        </div>
    }

    return (
        <div className={s.content}>
            {l}
        </div>
    )
}
